import React from 'react'
import s from './Footer.module.css'

const Footer1 = (props) => {




    return (
        <div className={s.Footer}>
            <div className={s.Button1}><span className={s.lable}>Сайт компании</span></div>
            <div className={s.Button2}><span className={s.lable}>Информация о направлении</span></div>
        </div>
    );
}


export default Footer1;
